import axios from "axios";
import { GET_DATA_AWAL, GET_DATA_SUCSSES, GET_DATA_FAIL } from "./actionTypes";

export const getData = (data) => (dispatch) => {
  dispatch({
    type: GET_DATA_AWAL,
    Loading: true,
    Error: null,
  });

  axios
  .post(`https://eli-uat-api.myequity.id/mobmyelife/services/api/v1/login` ,
  data)
  .then((response) => {
    dispatch({
      type: GET_DATA_SUCSSES,
      payload: response.data,

    });

  })
  .catch((err) => {
    console.log(err);
    dispatch({
      type: GET_DATA_FAIL,
      payload : err
    });
  });





